import React, { useState } from 'react'
import { FileUploader } from "react-drag-drop-files";
import './common.css'

const fileTypes = ["JPG", "PNG"];

const Cartoonify = () => {
	const [file, setFile] = useState(null);
  	const handleChange = (file) => {
		console.log(file);
    	setFile(file);
  	};

	return (
		<div className=''>
		<FileUploader children={<div><p>this is inside drop area</p></div>}
					  name="file" 
					  types={fileTypes}
					  hoverTitle="Drop here"
					  handleChange={handleChange} 
					  onTypeError={(err) => { window.alert(err) }}
					  onSizeError={(err) => { window.alert(err) }} />
		</div>
	);
};

export default Cartoonify;
